import React from 'react';

const Navbar = () => {
  return (
    <nav className="bg-blue-500 p-4">
      <div className="container mx-auto flex justify-between items-center">
        {/* Logo */}
        <div className="text-white text-2xl font-bold">Logo</div>

        {/* Search Bar */}
        <div className="w-1/2 relative">
          <input
            type="text"
            placeholder="Search..."
            className="w-full p-2 pr-10 rounded border border-gray-300"
          />
          <div className="absolute top-0 right-0 h-full flex items-center">
            <select className="bg-transparent text-white border-none outline-none">
              <option value="search">Search</option>
              <option value="filter">Filter</option>
            </select>
          </div>
        </div>

        {/* Login and Signup Buttons */}
        <div className="space-x-4">
          <button className="bg-white text-blue-500 px-4 py-2 rounded">Login</button>
          <button className="bg-blue-500 text-white px-4 py-2 rounded">Signup</button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
